import React from 'react';
import './toolbox.styles.css';

const Toolbox = () => {
  return (
    <div className="toolbox">
      <h2>Technologies</h2>

      <span>Node</span>
      <span>React</span>
      <span>Javascript</span>
      <span>Express</span>
    </div>
  );
};

export default Toolbox;
